help_broadcast: "โข {I {I} เดเตเตผเดเตเดเตเด <idch <idch / เดฒเดฟเดธเตเดฑเตเดฑเต / เดเดจเตเดจเตเดฎเดฟเดฒเตเดฒ> `\n    เดกเดพเดฑเตเดฑเดพเดฌเตเดธเดฟเดฒเตเดเตเดเต เดเดพเดฑเตเดฑเต เดเตเตผเดเตเดเตเด.เดเดกเดฟ เดตเตเดฏเดเตเดคเดฎเดพเดเตเดเดฟเดฏเดฟเดเตเดเดฟเดฒเตเดฒเตเดเตเดเดฟเตฝ เดจเดฟเดฒเดตเดฟเดฒเต เดเดพเดฑเตเดฑเต เดเตเตผเดเตเดเตเดจเตเดจเต.\n\nโข {I} REMCH <เดเดฒเตเดฒเดพเด / เดเดกเดฟ / เดเดจเตเดจเตเดฎเดฟเดฒเตเดฒ> `\n    เดจเดฟเตผเดฆเตเดฆเดฟเดทเตเด เดเดพเดฑเตเดฑเต เดจเตเดเตเดเดเดเตเดฏเตเดฏเตเดจเตเดจเต (เดจเดฟเดฒเดตเดฟเดฒเต เดเดพเดฑเตเดฑเต เดตเตเดฏเดเตเดคเดฎเดพเดเตเดเดฟเดฏเดฟเดเตเดเดฟเดฒเตเดฒเตเดเตเดเดฟเตฝ, เดเดฒเตเดฒเตเดเตเดเดฟเตฝ เดเดฒเตเดฒเดพ เดเดพเดฑเตเดฑเตเดเดณเตเด.\n\nโข {I} เดชเตเดฐเดเตเดทเตเดชเดฃเด <Msg- เดฒเตเดเตเดเต เดฎเดฑเตเดชเดเดฟ> `\n    เดกเดพเดฑเตเดฑเดพเดฌเตเดธเดฟเดฒเต เดเดฒเตเดฒเดพ เดเดพเดฑเตเดฑเตเดเตพเดเตเดเตเด เดฎเดฑเตเดชเดเดฟ เดจเตฝเดเดฟเดฏ เดธเดจเตเดฆเตเดถเด เดเดฏเดฏเตเดเตเดเตเด.\n\nโข {i}} m msg- เดฒเตเดเตเดเต เดฎเดฑเตเดชเดเดฟ> ``\n     เดกเดพเดฑเตเดฑเดพเดฌเตเดธเดฟเดฒเต เดเดฒเตเดฒเดพ เดเดพเดฑเตเดฑเตเดเตพเดเตเดเตเด เดธเดจเตเดฆเตเดถเด เดเตเดฎเดพเดฑเตเด.\n\nโข {I} เดฒเดฟเดธเตเดฑเตเดฑเดฟเดเตเดเดพเดจเดเตพ`\n    เดเดฒเตเดฒเดพ เดเดงเดฟเด เดเดพเดฑเตเดฑเตเดเดณเตเดเตเดฏเตเด เดชเดเตเดเดฟเด เดฒเดญเดฟเดเตเดเตเดจเตเดจเดคเดฟเดจเต."
